import{_ as e,c as n,a as r,o}from"./app-CTYZxEMR.js";const i={};function d(t,a){return o(),n("div",null,[...a[0]||(a[0]=[r('<p><a href="./技術的なメモ.html">技術的なメモ</a></p><p>私が主催するもくもく会。 逗子市の無料で使えるスペースでAndroidアプリ開発を皆が勝手にする、みたいな会にしたい。</p><p><a href="https://zushi-android-mokmok.connpass.com/" target="_blank" rel="noopener noreferrer">逗子Androidアプリ開発もくもく会 - connpass</a></p><h2 id="日時、場所" tabindex="-1"><a class="header-anchor" href="#日時、場所"><span>日時、場所</span></a></h2><ul><li>毎週木湯 17:00〜21:00</li><li>逗子市民交流センター（詳細は上記connpassのイベント参照)</li></ul><h2 id="概要" tabindex="-1"><a class="header-anchor" href="#概要"><span>概要</span></a></h2><p>以前<a href="./あおぞらAndroid教室.html">あおぞらAndroid教室</a>でやってたような感じで、集まってAndroidアプリ開発をする。 今の所自分ともうひとりでやろうと思っているが、もう2〜3人増やしてもいいかな、と思ってるので一般の人の参加も受け入れてみる試み。</p><p>基本的には最初に何をやるつもりか簡単に説明し、帰る前に一人5分くらいで簡単にやった事を話して解散、という流れ。</p><p>途中で参加したり帰ったりはOKだけど、参加した時に何をやるのかの説明と、帰る前に何をやったかの説明はやって欲しい。</p><p>時間的に夕飯にかぶるが夕飯は無い。終わったあとの懇親会とかも無い。 ただ疲れてきた時とかに途中で雑談になったりはする。</p><h2 id="交流センターの説明" tabindex="-1"><a class="header-anchor" href="#交流センターの説明"><span>交流センターの説明</span></a></h2><p>電源とWiFiはある（ただ自分はWiFiは使った事無い）。延長ケーブルは頼めば貸してくれる。 ホワイトボードはある。プロジェクタは無い。 食事は禁止。飲み物はOK。無料。</p>',12)])])}const p=e(i,[["render",d]]),h=JSON.parse('{"path":"/%E9%80%97%E5%AD%90Android%E3%82%A2%E3%83%97%E3%83%AA%E9%96%8B%E7%99%BA%E3%82%82%E3%81%8F%E3%82%82%E3%81%8F%E4%BC%9A.html","title":"","lang":"en-US","frontmatter":{},"git":{"updatedTime":1755158870000,"contributors":[{"name":"Kazuma Arino","username":"","email":"hogeika2@gmail.com","commits":1}],"changelog":[{"hash":"40341816d75530d7d7ca1cfd4d79fde88311b12a","time":1755158870000,"email":"hogeika2@gmail.com","author":"Kazuma Arino","message":"update"}]},"filePathRelative":"逗子Androidアプリ開発もくもく会.md"}');export{p as comp,h as data};
